import React from 'react';
import {melomamalogo} from '../assets/images/melomamalogo.jpeg';

const logo = {melomamalogo};

export default function Header() {
    return (
        <div>
            <img src={logo} alt="The Melo Mama Logo" />
        </div>
    )
}
